import React, { Component } from 'react'
import './index.css'
import { Input,Table } from 'antd';
// import http from './../../api'

export default class Home extends Component {
    state={
        num:'',
        data:[{name:'张三',age:24}]
    }
    constructor(props:Object){
        super(props)
    }
    onChange=(e:any)=>{
        const str = e.target.value
        this.setState(()=>{
            return {num:str}
        })
    }
   render(){
     return (<div>
         <div>
      <Input size="large" value={this.state.num} placeholder="请输入歌曲ID" onChange={this.onChange.bind(this)} />
         </div>
        <div>
        <Table dataSource={this.state.data}>
        </Table>
        </div>
     </div>)
  }
}
